        s += '+'  # Add a '+' to handle the last number

        for char in s:
            if char.isdigit():
                current_number = current_number * 10 + int(char)
            elif char in '+-*/':
                if current_operation == '+':
                    stack.append(current_number)
                elif current_operation == '-':
                    stack.append(-current_number)
                elif current_operation == '*':
                    stack[-1] = stack[-1] * current_number
                elif current_operation == '/':
                    stack[-1] = int(stack[-1] / current_number) if stack[-1] >= 0 else -(-stack[-1] // current_number)
                current_number = 0
                current_operation = char
            elif char == '(':  # Handle parentheses
                stack.append(current_operation)
                stack.append('(')
                current_operation = '+ '
            elif char == ')':
                if current_operation == '+':
                    stack.append(current_number)
                elif current_operation == '-':
                    stack.append(-current_number)
                elif current_operation == '*':
                    stack[-1] = stack[-1] * current_number
                elif current_operation == '/':
                    stack[-1] = int(stack[-1] / current_number) if stack[-1] >= 0 else -(-stack[-1] // current_number)
                current_number = 0
                # Calculate until we find '('
                temp_stack = []
                while stack and stack[-1] != '(':  
                    temp_stack.append(stack.pop())
                stack.pop()  # Remove '('
                current_operation = stack.pop() if stack else '+'  # Restore operation
                if current_operation == '+':
                    stack.append(sum(temp_stack))
                elif current_operation == '-':
                    stack.append(-sum(temp_stack))
                current_operation = '+'

        return sum(stack)

